import { Site } from '@/model';
import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-site',
  templateUrl: './site.component.html',
  styleUrls: ['./site.component.scss']
})
export class SiteComponent {
  @Input({ required: true }) data!: Site

}
<ng-container>
  <td>{{ data.id }}</td>
  <td>{{ data.checked }}</td>
  <td>{{ data.siteId }}</td>
  <td>{{ data.pod }}</td>
  <td>{{ data.lastRead }}</td>
  <td>{{ data.dc }}</td>
  <td>{{ data.address }}</td>
  <td>{{ data.city }}</td>
  <td>{{ data.state }}</td>
  <td>{{ data.meterType }}</td>
  <td>{{ data.zip }}</td>
  <td>{{ data.cycle }}</td>
  <td>{{ data.loadProfile }}</td>
  <td>{{ data.customer }}</td>
</ng-container>
